import React from "react"

import './input.css';
import Navbar from "../navbar/Navbar.jsx"

const products = [
  {
    id: 1,
    name: 'The Unicorn',
    description: 'They exist!',
    price: '$9.99',
    imageUrl: './food.jpg', // Replace with your image paths
  },
  {
    id: 2,
    name: 'The Fashionista',
    description: "You know he's got his own personal stylist.",
    price: '$9.99',
    imageUrl: './food.jpg',
  },
  {
    id: 3,
    name: 'The Drooler',
    description: 'Look at that crazy and cute face!',
    price: '$9.99',
    imageUrl: './food.jpg',
  },
];

const Product = ({ product }) => {
  return (
    <div className="max-w-sm rounded overflow-hidden shadow-lg bg-white text-center">
      <img className="w-full" src={product.imageUrl} alt={product.name} />
      <div className="px-6 py-4">
        <div className="font-bold text-xl mb-2">{product.name}</div>
        <p className="text-gray-700 text-base">{product.description}</p>
      </div>
      <div className="px-6 pt-4 pb-2">
        <span className="inline-block bg-purple-200 rounded-full px-3 py-1 text-sm font-semibold text-gray-700 mr-2 mb-2">{product.price}</span>
      </div>
    </div>
  );
};

const ProductsGrid = () => {
  return (
    <div>
      <Navbar />
      <main>
        <div className="py-8 bg-gray-100">
          <div className="container mx-auto px-6 md:px-12">
            <div className="text-center pb-12">
              <h2 className="text-4xl font-semibold mb-6">Get Doggy Stickers!</h2>
              <p className="text-gray-700 mb-8">
                Times are tough. Liven up your home with some cute Doggy Stickers. üê∂
              </p>
            </div>
            <div className="flex flex-wrap -mx-4">
              {products.map(product => (
                <div className="w-full sm:w-1/2 md:w-1/3 lg:w-1/4 px-4 mb-8" key={product.id}>
                  <Customer product={product} />
                </div>
              ))}
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};
  
export default Customer;
